`,paraId:42,tocIndex:0},{value:`/* 1.\u53D8\u91CF\u7C7B\u578B\u58F0\u660E\u548C\u521D\u59CB\u5316 */

let a: number;

// a \u7684\u7C7B\u578B\u8BBE\u7F6E\u4E3A\u4E86number\uFF0C\u5728\u4EE5\u540E\u7684\u4F7F\u7528\u8FC7\u7A0B\u4E2Da\u7684\u503C\u53EA\u80FD\u662F\u6570\u5B57
a = 10;
a = 33;
// a = 'hello'; // \u6B64\u884C\u4EE3\u7801\u4F1A\u62A5\u9519\uFF0C\u56E0\u4E3A\u53D8\u91CFa\u7684\u7C7B\u578B\u662Fnumber\uFF0C\u4E0D\u80FD\u8D4B\u503C\u5B57\u7B26\u4E32

let b: string;
b = 'hello';
// b = 123;

// \u58F0\u660E\u53D8\u91CF\u7684\u540C\u65F6\u76F4\u63A5\u8FDB\u884C\u8D4B\u503C
// let c: boolean = false;

// \u5982\u679C\u53D8\u91CF\u7684\u58F0\u660E\u548C\u8D4B\u503C\u662F\u540C\u65F6\u8FDB\u884C\u7684\uFF0CTS\u53EF\u4EE5\u81EA\u52A8\u5BF9\u53D8\u91CF\u8FDB\u884C\u7C7B\u578B\u68C0\u6D4B
let c = false;
c = true;

/* 2.\u51FD\u6570\u58F0\u660E */

// JS\u4E2D\u7684\u51FD\u6570\u662F\u4E0D\u8003\u8651\u53C2\u6570\u7684\u7C7B\u578B\u548C\u4E2A\u6570\u7684
// function sum(a, b){
//     return a + b;
// }

// console.log(sum(123, 456)); // 579
// console.log(sum(123, "456")); // "123456"

function sum(a: number, b: number): number {
  return a + b;
}

let res = sum(123, 345);
// let res = sum(123, '456'); // \u62A5\u9519

/* 3.\u5B57\u9762\u91CF\u58F0\u660E */

// \u4E0B\u9762\u7684\u8BED\u53E5\u76F8\u5F53\u4E8E\u5B9A\u4E49\u4E86\u4E00\u4E2Aa3\u5E38\u91CF\uFF1B
let a3: 10;
// a3 = 11; // \u5C1D\u8BD5\u5C06a3\u8D4B\u503C\u4E3A11\uFF0C\u62A5\u9519\uFF1B

/* 4.\u8054\u5408\u7C7B\u578B */

let b4: 'male' | 'female';
b4 = 'male';
b4 = 'female';

let c4: boolean | string;
c4 = true;
c4 = 'hello';

/* 5.\u7EC4\u5408\u7C7B\u578B */

// &\u8868\u793A\u540C\u65F6\u6EE1\u8DB3\u7684\u7C7B\u578B
let a5: { name: string } & { age: number };
a5 = { name: 'haha', age: 18 };

/* 6.\u5176\u4ED6\u5E38\u89C1\u57FA\u672C\u7C7B\u578B(\u9664\u4E86\uFF1Anumber\u3001string\u3001bool\u4E4B\u5916) */

/* 6.1 Any */

// any \u8868\u793A\u7684\u662F\u4EFB\u610F\u7C7B\u578B\uFF0C\u4E00\u4E2A\u53D8\u91CF\u8BBE\u7F6E\u7C7B\u578B\u4E3Aany\u540E\u76F8\u5F53\u4E8E\uFF1A\u5BF9\u8BE5\u53D8\u91CF\u5173\u95ED\u4E86TS\u7684\u7C7B\u578B\u68C0\u6D4B\uFF01
// \u4F7F\u7528TS\u65F6\uFF0C\u5F3A\u70C8\u4E0D\u5EFA\u8BAE\u4F7F\u7528any\u7C7B\u578B
// let d: any;

// \u58F0\u660E\u53D8\u91CF\u5982\u679C\u4E0D\u6307\u5B9A\u7C7B\u578B\uFF0C\u5219TS\u89E3\u6790\u5668\u4F1A\u81EA\u52A8\u5224\u65AD\u53D8\u91CF\u7684\u7C7B\u578B\u4E3Aany \uFF08\u9690\u5F0F\u7684any\uFF09
let a61;
a61 = 10;
a61 = 'hello';
a61 = true;

/* 6.2 Unknown */

let a62: unknown;
a62 = 10;
a62 = 'hello';
a62 = true;

/* 6.2.2 Unknown\u548CAny\u5BF9\u6BD4 */

let s: string = 'hello';
// a61\u7684\u7C7B\u578B\u662Fany\uFF0C\u5B83\u53EF\u4EE5\u8D4B\u503C\u7ED9\u4EFB\u610F\u53D8\u91CF
// any\u8D4B\u503C\u7ED9\u5176\u4ED6\u53D8\u91CF\u65F6\uFF0CTS\u4E5F\u4F1A\u540C\u65F6\u5173\u95ED\u5BF9\u90A3\u4E2A\u8D4B\u503C\u53D8\u91CF\u7684\u7C7B\u578B\u68C0\u67E5\uFF01
s = a61;

// a62\u7684\u7C7B\u578B\u662Funknown\uFF0C\u5B83\u4E0D\u80FD\u8D4B\u503C\u7ED9\u4E00\u4E2A\u786E\u5B9A\u7C7B\u578B\uFF01
// s = a62;

// \u5373\uFF1Aunknown \u5B9E\u9645\u4E0A\u5C31\u662F\u4E00\u4E2A\u7C7B\u578B\u5B89\u5168\u7684any
// unknown\u7C7B\u578B\u7684\u53D8\u91CF\uFF0C\u4E0D\u80FD\u76F4\u63A5\u8D4B\u503C\u7ED9\u5176\u4ED6\u53D8\u91CF
if (typeof a62 === 'string') {
  s = a62;
}

/* 6.3 void */

// void \u7528\u6765\u8868\u793A\u7A7A\uFF0C\u4E3B\u8981\u7528\u4E8E\u51FD\u6570\u4E2D
// \u4EE5\u51FD\u6570\u4E3A\u4F8B\uFF0C\u8868\u793A\u6CA1\u6709\u8FD4\u56DE\u503C\u7684\u51FD\u6570\uFF1A
function fn(): void {}

/* 6.4 undefined */

// never \u8868\u793A\u6C38\u8FDC\u4E0D\u4F1A\u8FD4\u56DE\u7ED3\u679C\uFF08\u8FDEundefined\u90FD\u6CA1\u6709\uFF09[\u8F83\u5C11\u4F7F\u7528]
// \u4E0B\u9762\u7684\u51FD\u6570\u6CA1\u6709\u8FD4\u56DE\u503C\uFF08\u8FDEundefined\u90FD\u6CA1\u6709\uFF09\uFF0C\u4EC5\u629B\u51FAerror
function fn2(): never {
  throw new Error('\u62A5\u9519\u4E86\uFF01');
}

/* 6.5 object */

// object\u8868\u793A\u4E00\u4E2Ajs\u5BF9\u8C61\u7C7B\u578B
let a65: object;
a65 = {};
a65 = function () {};

// {} \u7528\u6765\u6307\u5B9A\u5BF9\u8C61\u4E2D\u53EF\u4EE5\u5305\u542B\u54EA\u4E9B\u5C5E\u6027
